  \"2016-04-19T02:28:43.596311\",\n\t\"name\": \"traffic-count-study-area\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The City of Austin (COA) collects vehicle
  volume counts on an u201cas needed basis.u201d When a particular location needs
  a traffic study, COA adds these counts to the City of Austin Traffic Counts spreadsheet.
  COA does studies to install all-way stop and traffic signal controls, set speed
  limits, determine the need for school zones, and analyze traffic calming requests.
  The city does not collect any data on major highways within Austin. COA generally
  uses rubber tubes laid across roads that are attached to electronic traffic counters.
  \ Note: Traffic counts taken in June, July and August can be lower than average
  due to local school and University closures.   C.O.A. contact:  Jerry Carden @ (512)
